import "./Check.css";
import { useState, useEffect } from "react";
import { dividerClasses } from "@mui/material";

interface Symptons {
  ID: number;
  Name: String;
}

// https://healthservice.priaid.ch/symptoms?token=eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..KzRTXzpOzx5T8ZCkuLaBsAVr4-J4twZDHdAMALNX7K0&language=en-gb&format=json
// "https://sandbox-healthservice.priaid.ch/symptoms?token=eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..KzRTXzpOzx5T8ZCkuLaBsAVr4-J4twZDHdAMALNX7K0&language=en-gb&format=json"
export const Check = () => {
  const [symptonsData, setSymptonsData] = useState<Symptons[]>([]);
  const generalSymptoms = [11, 16, 9, 207, 13, 15, 29, 44, 101, 10, 50];

  useEffect(() => {
    const getSymptonData = async () => {
      const response = await fetch(
        "https://healthservice.priaid.ch/symptoms?token=eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..idaGQFa1e7bml6v1EJeDNckJ3Cot2E1toRAXpx1UR74&format=json&language=en-gb"
      );
      const data = await response.json();
      setSymptonsData(data);
    };

    getSymptonData();
  }, []);

  return (
    <div id="main-container">
      <h2>Choose your symptoms below</h2>
      {/* <div className="symptoms">
        {symptonsData.map((item) => (
          <label className="symptoms-label" key={item.ID}>
            <input className="symptoms-input" type="checkbox" />
            <span className="symptoms-span">{item.Name}</span>
          </label>
        ))}
      </div> */}
      <div className="symptoms">
        {generalSymptoms.map((id) => {
          const item = symptonsData.find((item) => item.ID === id);
          if (item) {
            return (
              <label className="symptoms-label" key={item.ID}>
                <input
                  className="symptoms-input"
                  id={item.ID.toString()}
                  type="checkbox"
                />
                <span className="symptoms-span">{item.Name}</span>
              </label>
            );
          }
          return null;
        })}
      </div>
    </div>
  );
};
